      <h2>{props.title}</h2>
      {props.body}
    </article>
  );
}
function App() {
  const topics = [
    {id:1, title:'html', body:'html is ...'},
    {id:1, title:'css', body:'css is ...'},
    {id:1, title:'javascript', body:'javascript is ...'}
  ]
  return (
    <div>
      <Header title="WEB"></Header>
      <nav topics={topics}> </nav>
      <Article title="Welcome" body="Hello,WEB"></Article>
    </div>
  );
}

export default App;
